import React from "react";
import { NavLink, withRouter, Link } from "react-router-dom";
import { Menu, Button, Image, Item } from "semantic-ui-react";
import { setCurrentUser } from "../actions/user";
import { connect } from "react-redux";

function AdminPanel(props) {
  return (
    <div>
      <h1>{props.selectedGroup.name} Admin Panel</h1>
      <Menu compact={true} style={{ alignItems: "center" }}>
        <Menu.Item name="edit club info">Edit Club Info</Menu.Item>

        <Menu.Item name="manage club books">Manage Club Books</Menu.Item>

        <Menu.Item name="manage club users">Manage Club Users </Menu.Item>
      </Menu>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    // user: state.user.user,
    user: state.user,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    setCurrentUser: (user) => dispatch(setCurrentUser(user)),
  };
};
export default withRouter(
  connect(mapStateToProps, mapDispatchToProps)(AdminPanel)
);
